import { Carousel } from 'react-bootstrap';
import { Component } from "react";


class ControlledCarousel extends Component {

    render() {
      return(
        <div>
<Carousel fade className="container">
  <Carousel.Item interval={3000}>
    <img
      className="d-block w-100"
      src="https://farm8.staticflickr.com/7347/13947735199_c8a200985f_b.jpg"
      alt="First slide"
    />
    <Carousel.Caption>
      <h3>First slide label</h3>
      <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
    </Carousel.Caption>
  </Carousel.Item>
  <Carousel.Item interval={3000}>
    <img
      className="d-block w-100"
      src="https://farm4.staticflickr.com/3774/9096965918_fc430e30b2_o.jpg"
      alt="Second slide"
    />

    <Carousel.Caption>
      <h3>Second slide label</h3>
      <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
    </Carousel.Caption>
  </Carousel.Item >
  <Carousel.Item interval={3000}>
    <img
      className="d-block w-100 h-"
      src="https://farm8.staticflickr.com/7051/13702226294_de73836c94_b.jpg"
      alt="Third slide"
    />

    <Carousel.Caption>
      <h3>Third slide label</h3>
      <p>Praesent commodo cursus magna, vel scelerisque nisl consectetur.</p>
    </Carousel.Caption>
  </Carousel.Item>
</Carousel>

        </div>



      )
    }
  }
  export default ControlledCarousel;

